import React from 'react';
import logo from './logo.svg';
import './App.css';
import data from './animearchive.json'
import { unstable_batchedUpdates } from 'react-dom';

function App() {
  return (


(<div>

<div class="Panel1"> 

  <input type="text" placeholder="Search Anime" id="DirectorySearch" class="Searchbar"></input>

   </div>

<div class="RenderList"> 

<ul id="Rendered">





</ul>

</div>

</div>)
  );
}

const StringData = JSON.stringify(data);

const listmap = StringData.map((key,value) => {
  return <li> <a href={value.Direct}> {value.Pagename}</a> </li>
});

React.render(

  {listmap},
  document.getElementById("Rendered")

);

export default App;
